import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Menu from "./Menu";
import "./styles/Header.css";
import { fetchACFData } from "../api";

const Header = () => {
  const [acfData, setAcfData] = useState({});
  // Fetch ACF data when the component mounts
  useEffect(() => {
    const getACFData = async () => {
      const data = await fetchACFData(); // Fetch the ACF data
      setAcfData(data); // Update the state with the fetched ACF data
    };
    getACFData(); // Call the function to fetch data
  }, []); // Empty dependency array means this effect runs only once when the component mounts
  console.log(acfData.logo.url);

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container-fluid">
      <a className="navbar-brand" href="/">
        <img 
          src="{acfData.logo.url}" 
          alt="Brand Logo" 
          className="d-inline-block align-top" />
      </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <Menu />
          </ul>
        </div>
      </div>
    </nav>
  );
};
export default Header;
